import {useForm} from "react-hook-form"
 const App=()=>{
  const {register,handleSubmit,formState:{errors}} =useForm();
  const tt=false
  const submitForm=(data)=>{
    console.log(data.email)
  }
  return(
    <>
    <form action="" onSubmit={handleSubmit(submitForm)}>
      <input type="text" {...register("name",{required:{message:"Enter name",value:true},maxLength:{message:"should length 10",value:10},disabled:{tt},onChange:(e)=>console.log(e.target.value)})} placeholder="Enter name" />
    {errors.name && <span>{errors.root.message}</span>}
      <input type="email" {...register("email",{required:true})} placeholder="Enter Email"/>
      <input type="submit" value="submit" />
    </form>
    </>
  )
}


export default App
